con:config.script:
import com.eviware.soapui.model.testsuite.Assertable.AssertionStatus





int counter = 1
testStep = testRunner.testCase.getTestStepByName('StopConference')



for (int x = 0; x < counter; x++)
{
testStep.run(testRunner, context)

if (testStep.assertionStatus == AssertionStatus.FAILED || AssertionStatus.FAIL)
{
    counter++
}
else if (testStep.assertionStatus == AssertionStatus.VALID)
{
    assert true
    break //jezeli StopConference nie zwroci asercji 404 to wyjdzie z petli i zacznie wykonywac kolejne kroki testowe
}
else
{
     log.error("please check your internet connection, something went wrong")
    assert false
    break
}}
